import './ExpenseForm.css';
const ExpenseForm = () => {
    return (
    <form>
        <div className='new-expense__control label'>
            <label>
                New Form
            </label>
            <input type='text'>Enter your name</input>
        </div>
    </form>
    );
}
export default ExpenseForm;
